import React from 'react';
import Header from '../Header/Header';
import FormInput from '../FormInput/FormInput'
import Tasks from '../Tasks/Tasks'
import ToDoButtom from '../ToDoButton/ToDoButton';
import style from './Form.css'

const Form = (listItems, clearInput,formInput,inputChange, addListItem, completedItem, removeItem) => {
    return(
        <form className={style.form}>
           <Header/>
           <FormInput clearInput={clearInput} inputChange={this.props.inputChange}/>
           <Tasks listItems={this.props.listItems}
                   addListItem={this.props.addListItem}
                   completedItem={this.props.completedItem}
                   removeItem={this.props.removeItem}/>
            <ToDoButtom addListItem={this.props.addListItem}/>
        </form>
    )
}

export default Form;
